// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IERC20 {
    function transfer(address recipient, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    function balanceOf(address account) external view returns (uint256);
}

contract Jukebox {
    address public owner;
    uint256 public albumCreationFee = 1 ether; // Default album creation fee (in Wei)
    uint256 public collectedFees; // Tracks fees collected by the Jukebox

    struct Album {
        string cid; // IPFS CID for the album directory
        address[] albumOwners; // Array of album owner wallet addresses
        address[] paymentTokens; // Array of ERC-20 token addresses for payment
        uint256 playFee; // Fee to play individual songs (in token units)
        uint256 wholeAlbumFee; // Fee to play the entire album (in token units)
        mapping(address => bool) isTokenAccepted; // Mapping for quick token lookup
    }

    mapping(string => Album) public albums; // Mapping of album names to Album structs
    string[] private albumNames; // Array to store album names for iteration
    mapping(string => bool) private albumExists; // To avoid duplicate album entries

    // Events
    event AlbumAdded(string albumName, string cid, address[] albumOwners, address[] paymentTokens, uint256 playFee, uint256 wholeAlbumFee);
    event SongPlayed(address indexed player, string albumName, uint256 trackNumber, address tokenUsed, uint256 amountPaid);
    event AlbumPlayed(address indexed player, string albumName, address tokenUsed, uint256 amountPaid);
    event Withdrawal(address indexed recipient, uint256 amount);
    event TokenAdded(string albumName, address token);
    event TokenRemoved(string albumName, address token);

    constructor() {
        owner = msg.sender;
    }

    // Modifier to restrict access to the contract owner
    modifier onlyOwner() {
        require(msg.sender == owner, "Only the contract owner can perform this action.");
        _;
    }

    // Function to set the album creation fee
    function setAlbumCreationFee(uint256 fee) external onlyOwner {
        albumCreationFee = fee;
    }

    // Function to add a new album
    function addAlbum(
        string memory albumName,
        string memory cid,
        address[] memory albumOwners,
        address[] memory paymentTokens,
        uint256 playFee,
        uint256 wholeAlbumFee
    ) external payable {
        require(msg.value >= albumCreationFee, "Insufficient fee to create album.");
        require(bytes(albumName).length > 0, "Album name cannot be empty.");
        require(bytes(cid).length > 0, "CID cannot be empty.");
        require(albumOwners.length > 0, "At least one album owner is required.");
        require(paymentTokens.length > 0, "At least one payment token must be provided.");

        // Collect creation fee
        collectedFees += msg.value;

        // Initialize album
        Album storage album = albums[albumName];
        require(bytes(album.cid).length == 0, "Album already exists."); // Prevent overwriting
        album.cid = cid;
        album.playFee = playFee;
        album.wholeAlbumFee = wholeAlbumFee;

        // Add album owners
        for (uint256 i = 0; i < albumOwners.length; i++) {
            require(albumOwners[i] != address(0), "Invalid album owner address.");
            album.albumOwners.push(albumOwners[i]);
        }

        // Add payment tokens
        for (uint256 i = 0; i < paymentTokens.length; i++) {
            address token = paymentTokens[i];
            album.paymentTokens.push(token);
            album.isTokenAccepted[token] = true;
        }

        // Track album name
        if (!albumExists[albumName]) {
            albumNames.push(albumName);
            albumExists[albumName] = true;
        }

        emit AlbumAdded(albumName, cid, albumOwners, paymentTokens, playFee, wholeAlbumFee);
    }

    // Function to fetch the total number of albums
    function getAlbumCount() external view returns (uint256) {
        return albumNames.length;
    }

    // Function to fetch album name by index
    function getAlbumNameByIndex(uint256 index) external view returns (string memory) {
        require(index < albumNames.length, "Index out of bounds");
        return albumNames[index];
    }

    // Function to fetch album details by name
    function getAlbumDetails(string memory albumName)
        external
        view
        returns (
            string memory cid,
            address[] memory albumOwners,
            address[] memory paymentTokens,
            uint256 playFee,
            uint256 wholeAlbumFee
        )
    {
        Album storage album = albums[albumName];
        require(bytes(album.cid).length > 0, "Album does not exist.");

        return (album.cid, album.albumOwners, album.paymentTokens, album.playFee, album.wholeAlbumFee);
    }

    // Function to play a song from an album
    function playSong(string memory albumName, uint256 trackNumber, address token) external {
        Album storage album = albums[albumName];
        require(bytes(album.cid).length > 0, "Album does not exist.");
        require(album.isTokenAccepted[token], "Token not accepted for this album.");

        IERC20 paymentToken = IERC20(token);
        require(paymentToken.balanceOf(msg.sender) >= album.playFee, "Insufficient token balance.");

        splitPayment(token, album.playFee, album.albumOwners);

        emit SongPlayed(msg.sender, albumName, trackNumber, token, album.playFee);
    }

    // Function to play the entire album
    function playAlbum(string memory albumName, address token) external {
        Album storage album = albums[albumName];
        require(bytes(album.cid).length > 0, "Album does not exist.");
        require(album.isTokenAccepted[token], "Token not accepted for this album.");

        IERC20 paymentToken = IERC20(token);
        require(paymentToken.balanceOf(msg.sender) >= album.wholeAlbumFee, "Insufficient token balance.");

        splitPayment(token, album.wholeAlbumFee, album.albumOwners);

        emit AlbumPlayed(msg.sender, albumName, token, album.wholeAlbumFee);
    }

    // Function to withdraw collected fees
    function withdrawFees() external onlyOwner {
        uint256 amount = collectedFees;
        collectedFees = 0;
        payable(owner).transfer(amount);

        emit Withdrawal(owner, amount);
    }

    function withdrawToken(address token, uint256 amount) external onlyOwner {
        IERC20 paymentToken = IERC20(token);
        require(paymentToken.balanceOf(address(this)) >= amount, "Insufficient token balance.");
        require(paymentToken.transfer(owner, amount), "Token withdrawal failed.");
    }

    // Function to split payment
    function splitPayment(address token, uint256 amount, address[] memory albumOwners) internal {
        IERC20 paymentToken = IERC20(token);

        uint256 platformShare = (amount * 10) / 100; // Platform takes 10%
        uint256 remainingShare = amount - platformShare;
        uint256 ownerShare = remainingShare / albumOwners.length;

        require(paymentToken.transferFrom(msg.sender, address(this), platformShare), "Platform share transfer failed.");

        for (uint256 i = 0; i < albumOwners.length; i++) {
            require(paymentToken.transferFrom(msg.sender, albumOwners[i], ownerShare), "Owner share transfer failed.");
        }
    }

    // Function to check if the caller is an owner of the album
    function isAlbumOwner(string memory albumName, address caller) internal view returns (bool) {
        Album storage album = albums[albumName];
        for (uint256 i = 0; i < album.albumOwners.length; i++) {
            if (album.albumOwners[i] == caller) {
                return true;
            }
        }
        return false;
    }

    // Function to add a token to an existing album
    function addToken(string memory albumName, address token) external {
        Album storage album = albums[albumName];
        require(bytes(album.cid).length > 0, "Album does not exist.");
        require(isAlbumOwner(albumName, msg.sender), "Caller is not an owner of the album.");
        require(!album.isTokenAccepted[token], "Token is already accepted.");

        album.paymentTokens.push(token);
        album.isTokenAccepted[token] = true;

        emit TokenAdded(albumName, token);
    }

    // Function to remove a token from an existing album
    function removeToken(string memory albumName, address token) external {
        Album storage album = albums[albumName];
        require(bytes(album.cid).length > 0, "Album does not exist.");
        require(isAlbumOwner(albumName, msg.sender), "Caller is not an owner of the album.");
        require(album.isTokenAccepted[token], "Token is not accepted.");

        // Remove token from the mapping
        album.isTokenAccepted[token] = false;

        // Remove token from the array
        address[] storage tokens = album.paymentTokens;
        for (uint256 i = 0; i < tokens.length; i++) {
            if (tokens[i] == token) {
                tokens[i] = tokens[tokens.length - 1]; // Move the last token to the current index
                tokens.pop(); // Remove the last element
                break;
            }
        }

        emit TokenRemoved(albumName, token);
    }
}

